import { generateUtilityClass, generateUtilityClasses } from '@mui/base';
export function getAvatarUtilityClass(slot) {
  return generateUtilityClass('MuiAvatar', slot);
}
const avatarClasses = generateUtilityClasses('MuiAvatar', ['root', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'fallback', 'sizeSm', 'sizeMd', 'sizeLg', 'img', 'variantOutlined', 'variantLight', 'variantContained']);
export default avatarClasses;
